    - content: >-
        Вся молодость — в годы войны. В 39-м прямо с первого курса рыбвтуза, успел всего два месяца проучиться, — повестка, и в армию. Направили в Белоруссию, с. Баравуха Полоцкой обл., а  еще через два месяца нас, молодых и спешно обученных, бросили на войну с Финляндией. Нам зачитали приказ, погрузили на платформы, а пока ехали до Петрозаводска, учили нас заряжать, стрелять. Хорошо, что с нами были старослужащие — командиры танков, опытные механики, а я был башенным стрелком. Нас в танке Т-26 три человека. Из Петрозаводска своим ходом к границе. На ней государственный знак — царский орел, мы его сбили и пошли вперед.  30 ноября 1939 г. Красная армия перешла в наступление по всей советско-финской 1200-км границе. И началось! Морозы были страшенные. Хлеб привезут, буханку ничем не разрежешь, не распилишь. Потом стали давать сухари.  Мы выход нашли: на мотор танка предварительно клали хлеб, чтобы оттаял, а вот пехоте трудно пришлось. Ели не по одному, а все вместе, глядя друг на друга: появились белые пятна на лице, обморожение,  тут же их растирать. Таких морозов я ни до, ни после финской не знал. Полушубков всем не хватало, танкисты  порой самостоятельно выбраться из танка не могли, металл леденел.  А в лесах на высоких елях «кукушки» поджидают, так звали женщин-снайперов, они буквально косили наших ребят.


        И всего-то 105-дневная война, «неизвестная война», как назвал ее поэт Александр Твардовский. О ней мало говорят и пишут, а потери наши там были вдвое больше, чем у финнов. И вот 12 марта 1940 г. подписан мирный договор с Финляндией. Наши танковые части вывели на территорию СССР, в Ленинградскую область. Но остался в памяти финский анекдот. Когда определяли границу, она прошла через домик лесника, одна комната – на финской стороне, другая — на советской. И его спросили: где будешь жить, на финской или советской стороне? Он подумал-подумал: на финской. Почему? А в Советском Союзе зимы холоднее.
      type: Paper
  - uid: 992
    components:
    - pos: -12.356751,15.656526
      parent: 1
      type: Transform
    - content: >-
        Родился я 2 августа 1923 г. в селе Пришиб Енотаевского района Астраханской области. А вот на фронт меня призывали с Дальнего Востока. Получилось вот как. Нас у родителей было четверо детей: два брата и две сестры. Я — третий по счету. Матери почти не помню, лет шести был, она умерла от родов. Отец женился на женщине, у которой тоже было двое детей. Решили завербоваться на Дальний Восток, на рыбные промысла. Старшая сестра осталась в Пришибе, ее удочерила одна семья. Мы же все отправились во Владивосток. Обосновались в поселке Сидими, после он был переименован, это часа два катером от Владивостока. Отец тоже рано умер, в 45 лет: провалившись под лед, промерз и заболел, оправиться уже не смог. В этом поселке я закончил семь классов. К началу войны был уже полным сиротой. Сестра замуж вышла. С мачехой поссорился, ушел к сестре. Поработал в рыболовецком колхозе. Пошел учиться на курсы мотористов. А тут война с Японией — Хасан. Какая уж тут учеба.


        Рассказывать о фронтовых годах мне стало все сложнее. Память не та, да и то сказать — 91 год. Не думал, что доживу до этих лет: и ранения были, и туберкулезом болел. А уж что пережито, до сих пор страшные сны мучают. Но попробую, расскажу, что вспомню.


        В армию меня призвали в конце 41-го. С месяц подучили. 23 февраля в 1942-м — воинская присяга — и на фронт.  Посадили в эшелоны и отправили под Воронеж. Дня через три получил ранение в руку. После госпиталя вернулся в свою часть. Потом брали Курск, тоже ранение, госпиталь. После выписки направили в другую часть на l-й Украинский фронт. С боями прошел до конца войны, был командиром стрелкового взвода, саперного. Ходил в разведку. Получал боевые награды – два ордена Красного Знамени, орден Славы, орден Красной Звезды, три медали «За отвагу» и другие. 10 апреля 1945 г. присвоено звание Героя Советского Союза.
